import { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Todo from './Todo'; //Todo 컴포넌트를 사용하기 위해 import
import { Example } from './Example'
import { Greeting, Farewell } from './Gretting';


function App() {
  // 하나의 할 일을 객체로 관리할 것이다
  // id, title, done
  const [item, setItem] = useState([{
    id:"0",
    title:"Hello world 1",
    done: true
  },
  {
    id:"1",
    title:"Hello world 2",
    done: false
  }])
  
  return (
    <div className="App">
      <Todo item={item[0]}/>
      <Todo item={item[1]}/>
    </div>
  );
  
}

export default App;
